import React from 'react';
import icon from './IconBar.module.css';
import YouTubeIcon from '@material-ui/icons/YouTube';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import EmailIcon from '@material-ui/icons/Email';
import AppleMusicIcon from '../assets/Apple_Music_Icon_blk.svg';

function IconBar() {
    return (
        <div className={icon.footer}>
            <ul class="social">
                <li>
                    <InstagramIcon style={styles.icon} />
                    <FacebookIcon style={styles.icon} />
                    <YouTubeIcon style={styles.icon} />
                    <EmailIcon style={styles.icon} />
                    <i class="fa fa-spotify" style={styles.icon} />
                </li>
                <li>
                    <img src={AppleMusicIcon} style={styles.icon} />
                </li>
            </ul>
        </div>
    );
}

const styles = {
    icon: {
        color: "black",
        padding: 2,
        fontSize: 30,
    },
};

export default IconBar;
